import React, { useState, useEffect } from "react";
import { View, Text, StyleSheet } from "react-native";

const ResultsList = () => {
  return (
    <View>
      <Text>Result Listr</Text>
    </View>
  );
};

const styles = StyleSheet.create({});

export default ResultsList;
